import Header from './Components/Header';
import Sidebar from './Components/Sidebar';
import './App.css';
import BodyInnerContainer from './Components/BodyInnerContainer';
import { Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header />
      <div className='body_container'>
        <Sidebar />
        <Routes>
          <BodyInnerContainer />
        </Routes>

      </div>

    </div>
  );
}

export default App;
